        </div>
      </div>

      <div className="nutriment">
        <img src={carbs} alt="" />
        <div>
          <h2>{dataCarbohydrate}g</h2>
          <h3>Glucides</h3>
        </div>
      </div>

      <div className="nutriment">
        <img src={fat} alt="" />
        <div>
          <h2>{dataLipid}g</h2>
          <h3>Lipides</h3>
        </div>
      </div>
    </div>
  );
};

export default AsideNutriment;


